import React from 'react';
import { Button, Card, CardBody, Form, FormInput } from 'shards-react';
import styled from 'styled-components';

const logo = "https://res.cloudinary.com/dn2vvg0sz/image/upload/v1584536307/logo_2x.png"

const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
`;

const Forms = styled(Form)`
.img-con {
    p {
        text-align: center;
    }
    .img-container {
        margin: 0 auto;
        display: block;
        margin-bottom: 2rem;
    }
}
`;

const Home = () => {
    return (
        <Container style={{ backgroundColor: '#ededed', height: '100vh' }} className="dr-example-container">
            <Forms>
                <Card>
                    <CardBody>
                        <div className="img-con">
                            <img className="img-container" src={logo} style={{ width: 50 }} alt="..." />
                            <p className="lead">Please Log In to Conet</p>
                        </div>
                        <FormInput style={{ marginBottom: 20 }} placeholder="Username" />
                        <FormInput style={{ marginBottom: 20 }} placeholder="Password" />
                        <Button theme="primary">Submit</Button>
                    </CardBody>
                </Card>
            </Forms>
        </Container>
    )
}

export default Home;
